import "./App.css";
import images from './Components/images'

import NavBar from './Components/NavBar'


function App() {
  return (
    <div>
      <h1> Tienda Flamenco </h1>
       <NavBar/>
       <h1> Camisetas </h1>
       <section className="cards">

          <figure className="card">
            <img src= {images.img1} alt="pain harold"></img>
          </figure>
       </section>
    </div>
  );
}

export default App;
